IF NOT EXISTS (
    select * from sysobjects where name='Peoples' and xtype='U'
) CREATE TABLE [Peoples] (
	[id]	uniqueidentifier,
    [name] NVARCHAR(100),
    [height] NVARCHAR(100),
    [mass] NVARCHAR(100),
    [hair_color] NVARCHAR(100),
    [skin_color] NVARCHAR(100),
    [eye_color] NVARCHAR(100),
    [birth_year] NVARCHAR(50),
    [gender] NVARCHAR(50),
    [homeworld] NVARCHAR(100),
    [films] NVARCHAR(1000),
    [species] NVARCHAR(1000),
    [vehicles] NVARCHAR(1000),
    [starships] NVARCHAR(1000),
    [created] Datetime2(7),
    [edited] Datetime2(7),
    [url] NVARCHAR(100)
);
